import React, { Component } from "react";
import { Helmet } from "react-helmet";

class Result extends Component {
  render () {
    return (
        <div className="application">
            <Helmet>
                <script src="https://use.typekit.net/foobar.js"></script>

            </Helmet>
            ...
        </div>
    );
  }
};

export default Result;
